INSERT INTO `sanphams` (`id`, `tensp`, `mota`, `mota_chinh`, `dongia`, `giacu`, `img`, `img_con`, `id_nhacungcap`, `id_loailon`, `id_loai`, `color`, `donvitinh`, `dinhluong`, `chatlieu`, `donggoi`, `khogiay`, `xuatxu`, `kichthuoc`, `thuonghieu`, `thetich`, `url`, `createdAt`, `updatedAt`) VALUES
(1, 'Giấy In A3 80gsm Double A', '<p>Double A l&agrave; một loại giấy cao cấp được biết đến với chất lượng cao, kiểu d&aacute;ng vượt trội v&agrave; th&acirc;n thiện với m&ocirc;i trường.</p>\r\n<p style=\"text-align: left;\">Tag: <span style=\"font-family: helvetica, arial, sans-serif;\"><strong><a href=\"https://www.youtube.com/watch?v=XNTA1kZ8_PI&amp;list=RDGMEMYH9CUrFO7CfLJpaD7UR85w&amp;index=7&amp;ab_channel=OWLSMusicstation\"><em>Gi&acirc;́y In</em></a>,</strong> <a href=\"https://www.youtube.com/watch?v=XNTA1kZ8_PI&amp;list=RDGMEMYH9CUrFO7CfLJpaD7UR85w&amp;index=7&amp;ab_channel=OWLSMusicstation\"><em><strong>Double A</strong></em></a>, <a href=\"https://www.youtube.com/watch?v=XNTA1kZ8_PI&amp;list=RDGMEMYH9CUrFO7CfLJpaD7UR85w&amp;index=7&amp;ab_channel=OWLSMusicstation\"><strong><em>A3</em></strong></a></span></p>', '<p><a title=\"Giấy in Double A A3 80gsm gi&aacute; tốt nhất -  chất lượng tại vppminhanh.vn\" href=\"https://vppminhanh.vn/san-pham-noi-bat/giay-in-double-a-kho-a3-80gsm\" target=\"_blank\" rel=\"noopener\"><strong>Giấy A3 Double A 80gsm</strong></a></p>\r\n<p>Double A l&agrave; một loại giấy cao cấp được biết đến với chất lượng cao, kiểu d&aacute;ng vượt trội v&agrave; th&acirc;n thiện với m&ocirc;i trường.</p>\r\n<p>K&iacute;ch thước: A3 : 500 tờ.</p>\r\n<p><strong>7 Ưu điểm của Giấy Double A</strong></p>\r\n<p>Tất cả mọi thứ l&agrave; chất xơ, v&agrave; h&agrave;m lượng chất xơ cao của&nbsp;<a title=\"Giấy in Double A A3 80gsm gi&aacute; tốt nhất -  chất lượng tại vppminhanh.vn\" href=\"https://vppminhanh.vn/san-pham-noi-bat/giay-in-double-a-kho-a3-80gsm\" target=\"_blank\" rel=\"noopener\">Double A&nbsp;</a>khiến n&oacute; trở th&agrave;nh giấy copy tốt nhất cho c&aacute;c d&ograve;ng m&aacute;y c&oacute; tốc độ cao. Dưới đ&acirc;y l&agrave; bảy l&yacute; do tại sao: &nbsp; &nbsp;</p>\r\n<p>&bull;<strong>&nbsp;Giấy A3 Double A 80gsm</strong>&nbsp;Khả năng vận h&agrave;nh tốt: M&aacute;y x&eacute;n giấy (th&agrave;nh tờ) của ch&uacute;ng t&ocirc;i c&oacute; độ quay ch&iacute;nh x&aacute;c l&agrave;m giảm đ&aacute;ng kể t&igrave;nh trạng kẹt giấy trong m&aacute;y photocopy, một chất lượng đ&atilde; được chứng minh trong cuộc kiểm tra cam go về Khả năng vận h&agrave;nh &ldquo;Kh&ocirc;ng Kẹt Giấy&rdquo; được thực hiện trong điều kiện ph&ograve;ng th&iacute; nghiệm độc lập trong đ&oacute; tốc độ 60 trang/ ph&uacute;t đ&atilde; được sao ch&eacute;p trong 24 giờ li&ecirc;n tục.&nbsp;</p>\r\n<p>&bull; Độ sắc n&eacute;t trong in ấn: bề mặt nhẵn của Double A cho ph&eacute;p mực được đồ tốt, tạo ra c&aacute;c bản sao sắc n&eacute;t như bản gốc. &nbsp; &nbsp;</p>\r\n<p>&bull; Độ nhẵn tuyệt vời: bề mặt nhẵn của<a title=\"Giấy in Double A A3 80gsm gi&aacute; tốt nhất -  chất lượng tại vppminhanh.vn\" href=\"https://vppminhanh.vn/san-pham-noi-bat/giay-in-double-a-kho-a3-80gsm\" target=\"_blank\" rel=\"noopener\"><strong>&nbsp;Giấy A3 Double A 80gsm</strong></a>&nbsp;khiến n&oacute; một sự tiếp x&uacute;c mực tốt v&agrave; l&agrave;m cho việc sao ch&eacute;p dễ d&agrave;ng, đặc biệt l&agrave; đối với c&aacute;c d&ograve;ng m&aacute;y c&oacute; tốc độ cao.&nbsp;</p>\r\n<p>&bull; Độ trắng s&aacute;ng Giấy A3 Double A 80gsm : Độ trắng của Double A l&agrave; 148-151 CIE tạo sự tương phản cao khi in v&agrave; khả năng chống phai m&agrave;u. &nbsp; &nbsp;</p>\r\n<p>&bull; Hiệu suất m&aacute;y in được n&acirc;ng cao: lưỡi dao cắt trong m&aacute;y x&eacute;n (<a title=\"Giấy in Double A A3 80gsm gi&aacute; tốt nhất -  chất lượng tại vppminhanh.vn\" href=\"https://vppminhanh.vn/san-pham-noi-bat/giay-in-double-a-kho-a3-80gsm\" target=\"_blank\" rel=\"noopener\">giấy</a>&nbsp;th&agrave;nh tờ) ti&ecirc;n tiến của ch&uacute;ng t&ocirc;i rất sắc b&eacute;n do đ&oacute; chỉ tạo ra một h&agrave;m lượng bụi rất thấp khi sử dụng loại giấy n&agrave;y để in ấn hay sao ch&eacute;p, k&eacute;o d&agrave;i tuổi thọ của thiết bị văn ph&ograve;ng. &nbsp; &nbsp;</p>\r\n<p>&bull; Sử dụng hai mặt: độ đục cao v&agrave; cấu tạo tuyệt vời từ xơ sợi chất lượng cao của Double A cho ph&eacute;p sử dụng cả hai mặt giấy. &nbsp; &nbsp;</p>\r\n<p>&bull; Thời gian lưu trữ t&agrave;i liệu d&agrave;i hơn: giấy kh&ocirc;ng Axit c&oacute; thời hạn sử dụng l&acirc;u hơn, khiến n&oacute; trờ th&agrave;nh loại giấy ho&agrave;n hảo đối với việc lưu trữ t&agrave;i liệu.</p>', '168000', '200000', 'giay-in-a3-80gsm-double-a.png', 'giay-in-a3-80gsm-double-a.png,ghi-note-5-mau-nhua-double-a.png,giay-ghi-chu-vang-pronoti-kt-3-3.png,giay-in-a3-70gsm-double-a.png', 1, 10, 20, '', '', '', '', '5 Ram/Thùng', 'A3', 'Thái Lan', '', 'Double A', '', 'giay-in-a3-80gsm-double-a', NULL, '2023-05-24 13:06:56'),
(2, 'Giấy In A3 70gsm Double A', 'Double A là một loại giấy cao cấp được biết đến với chất lượng cao, kiểu dáng vượt trội và thân thiện với môi trường.', NULL, '147000', NULL, 'giay-in-a3-70gsm-double-a.png', 'giay-in-a3-70gsm-double-a.png', 1, 10, 20, NULL, 'Ram', NULL, NULL, '5 Ram/Thùng', 'A3', 'Thái Lan', NULL, 'Double A', NULL, 'giay-in-a3-70gsm-double-a', NULL, NULL),
(3, 'Giấy In A3 80gsm - Excel', 'Mặt giấy in Excel láng và rất mịn giấy in không bị nhăn và lem mực.\n\nThích hợp cho các nhân viên văn phòng. Excel là loại giấy đẹp, chất lượng cao với giá thành thấp.\n\nChuyên dùng cho máy photocopy, máy in mực, in laser, máy fax, in off-set.', NULL, '118000', NULL, 'giay-in-a3-80gsm-excel.png', 'giay-in-a3-80gsm-excel.png', 1, 10, 21, NULL, 'Ream', '80gsm', NULL, NULL, 'A3', 'Indonesia', NULL, 'Excel', NULL, 'giay-in-a3-80gsm-excel', NULL, NULL),
(4, 'Giấy In A3 70gsm - Excel', 'Mặt giấy in Excel láng và rất mịn giấy in không bị nhăn và lem mực.\r\n\r\nThích hợp cho các nhân viên văn phòng. Excel là loại giấy đẹp, chất lượng cao với giá thành thấp.\r\n\r\nChuyên dùng cho máy photocopy, máy in mực, in laser, máy fax, in off-set.', NULL, '99000', NULL, 'giay-in-excel-a3-70gsm.png', 'giay-in-excel-a3-70gsm.png', 1, 10, 21, NULL, 'Ream', '70gsm', NULL, NULL, 'A3', 'Indonesia', NULL, 'Excel', NULL, 'giay-in-a3-70gsm-excel', NULL, NULL),
(5, 'Ghi Note 5 Màu Nhựa- Double A', 'Giấy bắt mực tốt, cho mực nhanh khô, không lem nhòe, không làm mực bị in hằn sang mặt sau. Người dùng có thể dễ dàng mang theo sản phẩm bên mình, sử dụng mọi lúc mọi nơi, vô cùng tiện lợi. Giấy màu trơn, không hoa văn, có nhiều màu sắc thanh nhã, tươi sán', NULL, '9500', NULL, 'ghi-note-5-mau-nhua-double-a.png', 'ghi-note-5-mau-nhua-double-a.png', 2, 11, 22, '5 màu', 'Xấp', NULL, 'Nhựa', '100 tờ /xấp', NULL, NULL, '42mm x 12mm', 'Double A', NULL, 'ghi-note-5-mau-nhua-double-a', NULL, NULL),
(6, 'Note UNC KT 3*3', 'Đặc tính của giấy note là giúp các bạn quản lý và tổ chức kế hoạch trong thời gian dài hạn, nhắc nhở bạn những việc cần làm. Ngay cả trong những lúc bận rộn nhất bạn cũng có thể ghi chú 1 cách dễ dàng, mọi nơi.', NULL, '6500', NULL, 'note-unc-kt-3-3.png', 'note-unc-kt-3-3.png\n', 2, 11, 22, NULL, 'Xấp (100 tờ/xấp)', NULL, NULL, '12 xấp / lốc', NULL, NULL, NULL, 'Unicorn', NULL, 'note-unc-kt-3-3', NULL, NULL),
(8, 'Note Pronoti 5 Màu - Giấy', 'Pronoti là nhãn hiệu nổi tiếng về giấy note, một trong những sản phẩm đó là Giấy note 5 màu giấy Pronoti , sản xuất theo công nghệ sản xuất giấy đến từ Đài Loan.', NULL, '9500', NULL, 'note-pronoti-5-mau-giay.png', 'note-pronoti-5-mau-giay.png', 1, 11, 23, '5 màu', 'Xấp', NULL, NULL, '36 xấp/hộp', NULL, NULL, NULL, 'Pronoti', NULL, 'note-pronoti-5-mau-giay', NULL, NULL),
(9, 'Note Pronoti KT 3*4 Cm', 'Giấy màu vàng nổi bật, đẹp mắt. Phục vụ tốt nhu cầu làm việc, chất keo bền lâu, khó bong tróc. Giấy note sử dụng đa dạng ở nhiều nơi, nhiều công việc, ngành nghề khác nhau.', NULL, '6500', NULL, 'giay-ghi-chu-vang-pronoti-kt-3-3.png', 'giay-ghi-chu-vang-pronoti-kt-3-3.png', 1, 11, 23, NULL, 'Xấp', NULL, NULL, NULL, NULL, 'Đài Loan', '7,6cm*7,6cm', 'Pronoti', NULL, 'giay-ghi-chu-vang-pronoti-kt-3-3', NULL, NULL),
